INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1000001, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, 3.414, 190803, "2030/01/01 14:59:59", 62, 2, 0.0, -416.5, 1, "カリン", "2025/01/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1000002, "ミッションをクリアして、\n報酬をゲットしましょう！", 1, 3.099, 190803, "2030/01/01 14:59:59", 62, 2, 0.0, -416.5, 2, "カリン", "2025/01/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1000003, "受け取ることができる\n報酬があるようです\n確認してみてください", 1, 2.801, 190803, "2030/01/01 14:59:59", 63, 2, 0.0, -416.5, 3, "カリン", "2025/01/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1000004, "報酬がもらえますよ！\nチェックしてみてください", 1, 0.0, 190803, "2030/01/01 14:59:59", 63, 2, 0.0, -416.5, 4, "カリン", "2025/01/31 12:00:00", 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1000005, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 1, 2.12, 190803, "2030/01/01 14:59:59", 64, 1, 0.0, -363.0, 5, "カリン", "2025/01/31 12:00:00", 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1000006, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 1, 1.68, 190803, "2030/01/01 14:59:59", 64, 2, 0.0, -363.0, 6, "カリン", "2025/01/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1000007, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 1, 2.33, 190803, "2030/01/01 14:59:59", 64, 1, 0.0, -363.0, 7, "カリン", "2025/01/31 12:00:00", 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020101, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 10201, 5.18, 133701, "2030/01/01 14:59:59", 61, 7, -6.0, -285.0, 101, "ラビリスタ", "2025/01/31 12:00:00", 3);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020102, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 10201, 8.77, 133901, "2030/01/01 14:59:59", 61, 2, -2.0, -285.0, 201, "クリスティーナ", "2025/01/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020103, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 10201, 15.5, 133801, "2030/01/01 14:59:59", 61, 1, 0.0, -285.0, 301, "ネネカ", "2025/01/31 12:00:00", 6);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020201, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 10202, 9.061, 134301, "2030/01/01 14:59:59", 61, 5, 0.0, -285.0, 101, "ランファ", "2025/02/28 12:00:00", 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020202, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 10202, 7.699, 134401, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 201, "チカ", "2025/02/28 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020301, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 10203, 8.595, 134601, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 101, "アオイ", "2025/03/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020302, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 10203, 7.758, 134501, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 201, "クローチェ", "2025/03/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020401, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 10204, 7.0, 132302, "2030/01/01 14:59:59", 61, 6, 0.0, -285.0, 101, "ルイズマリー", "2025/04/30 12:00:00", 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020402, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 10204, 7.904, 132402, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 201, "イロハ", "2025/04/30 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020403, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 10204, 8.487, 132502, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 301, "ソノ", "2025/04/30 12:00:00", 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020502, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 10205, 8.763, 134901, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 101, "カノン", "2025/05/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020503, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 10205, 6.417, 134801, "2030/01/01 14:59:59", 61, 3, 0.0, -285.0, 201, "ツムギ", "2025/05/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020601, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 10206, 10.335, 135001, "2030/01/01 14:59:59", 61, 7, 0.0, -285.0, 101, "エリス", "2025/06/30 12:00:00", 3);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020602, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 10206, 6.281, 135101, "2030/01/01 14:59:59", 61, 4, 0.0, -285.0, 201, "シェフィ", "2025/06/30 12:00:00", 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020603, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 10206, 12.244, 135201, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 301, "プレシア", "2025/06/30 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020701, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 10207, 6.339, 135301, "2030/01/01 14:59:59", 61, 8, 0.0, -285.0, 101, "クリア", "2025/07/31 12:00:00", 2);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020702, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 10207, 8.184, 135401, "2030/01/01 14:59:59", 61, 9, 0.0, -285.0, 201, "アネモネ", "2025/07/31 12:00:00", 7);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020801, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 10208, 3.906, 129101, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 101, "アイラ", "2025/08/31 12:00:00", 9);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020802, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 10208, 14.465, 129201, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 201, "シナツ", "2025/08/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020803, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 10208, 8.662, 100101, "2030/01/01 14:59:59", 61, 3, 0.0, -285.0, 301, "ヒヨリ", "2025/08/31 12:00:00", 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020804, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 10208, 10.915, 100301, "2030/01/01 14:59:59", 61, 3, 0.0, -285.0, 401, "レイ", "2025/08/31 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020901, "あ、ど、ども…\nあ、あんま見ねぇでくれっと\nその、恥ずかしくて…\n体が熱くなって、溶けちまう…", 10209, 6.042, 135802, "2030/01/01 14:59:59", 61, 7, 0.0, -285.0, 101, "ユキノ", "2025/09/30 12:00:00", 1);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020902, "なんで俺が幽霊に…意味不明だ\nこれじゃ死んでも死にきれねェ\n悪ィがこれも何かの縁だ、\nよろしく頼むぜ騎士公", 10209, 9.402, 135903, "2030/01/01 14:59:59", 61, 1, 0.0, -285.0, 201, "サツキ", "2025/09/30 12:00:00", 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1020903, "う、うじゅる…\nサツキ姉しゃまを助けるためにも\nまずは、腹ごしらえでしゅね…！\nタコ焼き、召し上がってくだしゃい", 10209, 8.16, 136902, "2030/01/01 14:59:59", 61, 1, 0.0, -285.0, 301, "ルルィ", "2025/09/30 12:00:00", 8);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1021001, "ひさしぶりのジオ・ゲヘナ\n歓迎パーティーで起きた殺人事件！\nランドソルの名探偵の名にかけて\n解き明かしてみせようじゃないか！", 10210, 5.0, 137401, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 101, "カスミ", "2025/10/31 12:00:00", 3);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1021002, "…わたしはどこの誰なのでしょう\nどこから来てどこへ行くのでしょう\nこの事件の真相が分かれば、\n何かが掴めるような気がいたします", 10210, 8.12, 136001, "2030/01/01 14:59:59", 61, 1, 0.0, -285.0, 201, "アラクネ", "2025/10/31 12:00:00", 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1021003, "ナーナ、すいりとかろんぱとか、\nむずかしくてわかんないけど…\nお友だちとドーナツのためならっ\nせーいっぱいがんばるよっ！", 10210, 6.386, 136202, "2030/01/01 14:59:59", 61, 2, 0.0, -285.0, 301, "ナーナ", "2025/10/31 12:00:00", 4);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1021101, "騎士クンに想いを伝えたい…だから\nミソラちゃん、わたしがんばるね！\n…あれ？　わたし、なんでこんなに\n必死になってるんだろう…？", 10211, 7.438, 136402, "2030/01/01 14:59:59", 61, 4, 0.0, -285.0, 101, "ユイ", "2025/11/30 12:00:00", 3);
INSERT INTO `v1_d147e04d639daf4e0c12b967542218102d13183cf844d2bb20d47f6e448b6a30` VALUES (1021102, "騎士さんとのデートはわたしに\nお任せです★　なのでユイさんは\n安心して計画に専念して…たくさん\nドキドキしちゃってくださいね", 10211, 8.35, 136302, "2030/01/01 14:59:59", 61, 5, 0.0, -285.0, 201, "ミソラ", "2025/11/30 12:00:00", 1);
